import React from 'react'
import { Container, Nav, NavDropdown, Navbar as Navbox } from 'react-bootstrap'
import { ReactComponent as Gitlogo } from '../../assets/gitlogo.svg';
import './Navbar.css';

function Navbar() {
  return (
    <>
        {/* hello world */}
        {/* <Gitlogo /> */}

        <Navbox expand="lg" className="navbar-bg-color">
            <Container>
                <Gitlogo color="#ffffff" />
                <div className="navbar-p">
                    <p>Pull request</p>
                    <p>Issues</p>
                    <p>Marketplace</p>
                    <p>Explore</p>
                </div>


            </Container>
        </Navbox>
    </>
  )
}

export default Navbar
